import React, {useCallback, useEffect, useState} from 'react';
import {Text, Pressable, View, Button} from 'react-native';
import {launchCamera, launchImageLibrary} from 'react-native-image-picker';
import styles from './styles.js';
import actions from './constants.js';

const ModalOptions = ({navigation}) => {
  const [response, setResponse] = useState(null);
  useEffect(() => {
    if (response?.assets) {
      const image = response.assets[0].uri;
      const googleBody = JSON.stringify({
        requests: [
          {
            features: [
              {
                type: 'WEB_DETECTION',
                maxResults: 1,
              },
            ],
            image: {
              content:
                '',
            },
          },
        ],
      });
      const googleResponse = fetch(
        // eslint-disable-next-line quotes
        `https://vision.googleapis.com/v1/images:annotate?key=GOOGLE_KEY`,
        {
          headers: {
            Accept: 'application/json',
            'Content-Type': 'application/json',
          },
          method: 'POST',
          body: googleBody,
        },
      )
        .then(rawResponse => {
          return rawResponse.json();
        })
        .then(googleResponseJson => {
          const bestGuess = JSON.stringify(
            googleResponseJson.responses[0].webDetection.bestGuessLabels[0]
              .label,
          );

          const discogsSearchResponse = fetch(
            // eslint-disable-next-line quotes
            `https://api.discogs.com/database/search?q=${encodeURIComponent(
              bestGuess,
            )}&type=release&key=DISCOGS_KEY&secret=DISCOGS_SECRET`,
          )
            .then(rawResponse => {
              return rawResponse.json();
            })
            .then(discogsSearchResponseJson => {
              const discogsReleaseResponse = fetch(
                // eslint-disable-next-line quotes
                `https://api.discogs.com/releases/${discogsSearchResponseJson.results[0].id}?key=DISCOGS_KEY&secret=DISCOGS_SECRET`,
              )
                .then(rawResponse => {return rawResponse.json()})
                .then(discogsReleaseResponseJson => {
                  navigation.navigate('Record', {
                    data: discogsReleaseResponseJson,
                  });
                  // alert(`https://api.discogs.com/releases/${discogsSearchResponseJson.results[0].id}?key=DISCOGS_KEY&secret=DISCOGS_SECRET`)
                  // alert(JSON.stringify(discogsReleaseResponse));
                });
            });
        });
      return () => {
        alert('cleaning!');
        setResponse(null);
      };
    }
  }, [response]);
  const onButtonPress = useCallback((type, options) => {
    if (type === 'capture') {
      launchCamera(options, setResponse);
    } else if (type === 'library') {
      launchImageLibrary(options, setResponse);
    }
  }, []);

  return (
    <View style={styles.centeredView}>
      <View style={styles.centeredView}>
        <View style={styles.modalView}>
          <View style={styles.buttonContainer}>
            {actions.map(({title, type, options}) => {
              return (
                <Button
                  title={title}
                  key={title}
                  onPress={() => onButtonPress(type, options)}>
                  {title}
                </Button>
              );
            })}
          </View>
          <Pressable
            style={styles.button}
            onPress={() => navigation.goBack()}>
            <Text style={styles.textStyle}>Cancel</Text>
          </Pressable>
        </View>
      </View>
    </View>
  );
};

export default ModalOptions;
